import React, { useState } from "react";
import { StyleSheet, TouchableOpacity, View } from "react-native";
import {
  VStack,
  HStack,
  Button,
  IconButton,
  Icon,
  Text,
  NativeBaseProvider,
  Center,
  Box,
  StatusBar,
} from "native-base";
import { MaterialIcons } from "@expo/vector-icons";

const FlexDirectionBasics = () => {
  const [flexDirection, setflexDirection] = useState("column");

  return (
    /* <PreviewLayout
      label="Purrrfect Pets"
      values={["The Adventure Quiz", "Your Pets", "Dashboard", "Settings"]}
      selectedValue={flexDirection}
      setSelectedValue={setflexDirection}
    >
      <View style={[styles.header, { backgroundColor: "powderblue" }]}>
        <Text
          style={[
            { fontWeight: 500 },
            { fontFamily: "Roboto" },
            { textAlign: "center" },
            { fontSize: 30 },
          ]}
        >
          {" "}
          Choose Your Own Adventure, answer the questions to find your purrrfect
          pet!{" "}
        </Text>
      </View>

      <View style={[styles.box, { backgroundColor: "skyblue" }]}>
        <TouchableOpacity style={[styles.selected2]}>
          <Text
            style={[
              { fontWeight: 500 },
              { textAlign: "center" },
              { fontSize: 30 },
            ]}
          >
            {" "}
            Yes{" "}
          </Text>
        </TouchableOpacity>
      </View>
      <View style={[styles.box, { backgroundColor: "steelblue" }]}>
        <TouchableOpacity style={[styles.selected2]}>
          <Text
            style={[
              { fontWeight: 500 },
              { textAlign: "center" },
              { fontSize: 30 },
            ]}
          >
            {" "}
            No{" "}
          </Text>
        </TouchableOpacity>
      </View>
    </PreviewLayout>*/
    <>
      <StatusBar backgroundColor="#3700B3" barStyle="light-content" />

      <Box safeAreaTop backgroundColor="#6200ee" />

      <HStack
        bg="#6200ee"
        px={1}
        py={3}
        justifyContent="space-between"
        alignItems="center"
      >
        <HStack space={4} alignItems="center">
          <IconButton
            icon={
              <Icon
                size="sm"
                as={<MaterialIcons name="menu" />}
                color="white"
              />
            }
          />
          <Text color="white" fontSize={20} fontWeight="bold">
            Home
          </Text>
        </HStack>
        <HStack space={2}>
          <IconButton
            icon={
              <Icon
                as={<MaterialIcons name="favorite" />}
                size="sm"
                color="white"
              />
            }
          />
          <IconButton
            icon={
              <Icon
                as={<MaterialIcons name="search" />}
                color="white"
                size="sm"
              />
            }
          />
          <IconButton
            icon={
              <Icon
                as={<MaterialIcons name="more-vert" />}
                size="sm"
                color="white"
              />
            }
          />
        </HStack>
      </HStack>
    </>
  );
};

export default function () {
  return (
    <NativeBaseProvider>
      <AppBar />
    </NativeBaseProvider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 8,
    backgroundColor: "aliceblue",
  },
  header: {
    width: 360,
    height: 400,
  },
  box: {
    width: 360,
    height: 70,
  },
  row: {
    flexDirection: "row",
    flexWrap: "wrap",
  },
  button: {
    paddingHorizontal: 8,
    paddingVertical: 6,
    borderRadius: 4,
    backgroundColor: "oldlace",
    alignSelf: "flex-start",
    marginHorizontal: "1%",
    marginBottom: 6,
    minWidth: "48%",
    textAlign: "center",
  },
  selected: {
    backgroundColor: "coral",
    borderWidth: 0,
  },
  selected2: {
    opacity: 0.5,
  },
  buttonLabel: {
    fontSize: 12,
    fontWeight: "500",
    color: "coral",
  },
  selectedLabel: {
    color: "white",
  },
  label: {
    textAlign: "center",
    marginBottom: 10,
    fontSize: 24,
  },
});
